import Tabs from './Tabs.vue'

export default {
  name: 'Header',
  props: {
    activeTab: String
  },
  components: {
    Tabs
  },
  data: function() {
    return {
      tabs: [
        {
          label: "ABOUT",
          active: false,
          url: "/about"
        }, {
          label: "CONTACT US",
          active: false,
          url: "/contact-us"
        }, {
          label: "VOLUNTEERS",
          active: false,
          url: "/volunteers"
        }, {
          label: "SPEAKERS",
          active: false,
          url: "/speakers"
        }, {
          label: "SCHOOL DISTRICT",
          active: false,
          url: "/school-district"
        }, {
          label: "COMMUNITY ORGANIZATIONS",
          active: false,
          url: "/community-organizations"
        }, {
          label: "SPONSORS",
          active: false,
          url: "/sponsors"
        }, {
          label: "DONATE NOW",
          active: false,
          url: "/donate-now"
        }, {
          label: "COUNSELORS",
          active: false,
          url: "/counselors"
        }, {
          label: "STUDENTS",
          active: false,
          url: "/students"
        }
      ]
    }
  },
  methods: {
    switchTab: function(tab) {
      for(var i = 0; i < this.tabs.length; i++) {
        this.tabs[i].active = false;
        if(this.tabs[i].label === tab) {
          var temp = this.tabs[i];
          temp.active = true;
          this.tabs.splice(i, 1, temp);
        }
      }
    },
  },
  mounted() {
    this.switchTab("ABOUT");
  }
}
